  false,\n\t\"url\": null,\n\t\"notes\": \"<p>Each day, between 12 to 13 U.S. workers
  die as a result of a traumatic injury on the job. Investigations conducted through
  the FACE program allow the identification of factors that contribute to these fatal
  injuries. This information is used to develop comprehensive recommendations for
  preventing similar deaths. This web page provides access to NIOSH investigation
  reports and other safety resources.</p>n\",\n\t\"license_title\": \"License Not
